const styles = (theme) => ({
  autocomplete: {
    flex: '1 1 70%',
    marginTop: theme.spacing(0.75),
    marginRight: theme.spacing(0.5),
  },
  button: {
    flex: '0 1 auto',
    height: 44,
    marginTop: theme.spacing(0.5),
  },
});

export default styles;
